import React from 'react';

export default function Home(){
  return (
    <section className="page-hero">
      <div className="container">
        <h1 className="title-lg">Welcome to MediConnect</h1>
        <p className="subtitle">Use the navigation to login or register and explore doctors.</p>
      </div>
    </section>
  );
}
